import logo from './logo.svg';
import './style.css'
import Button from './Button';

export default function Theme() {
    return (
      <div className="Theme">
        <h1>React Themes Demo</h1>
        <div className='btn'>
        <Button color />
        </div>
        <img src={logo} className="App-logo" alt="logo" />
      </div>
    )
  }
